import React from 'react'
import Popup from 'reactjs-popup';
import { useNavigate } from 'react-router-dom'

const LOCAL_STORAGE_KEY = 'jarvis.subscription'

export default function Subscriptions() {
  const [subscription, setSubscription] = useState("bronze")
  const navigate = useNavigate()

  const onOKClick = () => {
    navigate('/home');
  }

  return (
    <div className={'mainContainer'}>
        <p>Subscriptions</p>
        <div className={'radioEntry'}>
          <input type="radio" id="html" name="sub" value="bronze" defaultChecked/>
          <label for="bronze">Bronze: 5 scheduled and 2 unscheduled rides per week.</label>
        </div>

        <div className={'radioEntry'}>
          <input type="radio" id="html" name="sub" value="silver"/>
          <label for="silver">Silver: 10 scheduled and 4 unscheduled rides per week.</label>
        </div>

        <div className={'radioEntry'}>
          <input type="radio" id="javascript" name="sub" value="gole"/>
          <label for="gold">Gold: 20 scheduled and 8 unscheduled rides per week.</label>
        </div>

        <Popup trigger=
        {<button >Save</button>}
        modal nested className={'modal'}>
          <p>Thank you.</p>
          <button onClick={onOKClick}>OK</button>
      </Popup>
    </div>
  )
}
